import React from 'react';


type TodolistType = {
    title:string;
    task:TaskType[]
}

type TaskType= {
    id:string;
    title:string;
    isDone:boolean
}






export  const Todolist:React.FC<TodolistType> = ({task,title,...props}) => {


    return (
        <div>
            <h3>{title}</h3>
            <input/>
            <button>Add</button>
           <ul>{task.map((el)=>{
               return( <li key={el.id}>
                   {el.title}
                   <input type={"checkbox"} checked={el.isDone}/>
                   <button>X</button>
               </li>)
               })

           }

           </ul>

            <button>All</button>
            <button>Active</button>
            <button>Completed</button>
        </div>
    );
};
